import {useContext} from "react";
import {UserContext} from "../UserContext";
import Navbar from "../components/Navbar";
import {useParams} from "react-router-dom";
import ProfileNav from "../components/ProfileNav";
import ProfileBody from "../components/ProfileBody";
import ProfileSellings from "../components/ProfileSellings";
import ProfileBuyings from "../components/ProfileBuyings";
import ProfileNewSelling from "../components/ProfileNewSelling";

export default function ProfilePage() {
    const {user, ready} = useContext(UserContext);
    const {subpage, action} = useParams();

    if (!ready) {
        return "Loading...";
    }

    if (ready && user) {
        if (!subpage) {
            return (
                <div>
                    <Navbar/>
                    <ProfileNav/>
                    <ProfileBody user={user}/>
                </div>
            );
        }
        if (subpage === 'sellings') {
            return (
                <div>
                    <Navbar/>
                    <ProfileNav/>
                    {!action && (
                        <ProfileSellings/>
                    )}
                    {action === 'new' && (
                        <ProfileNewSelling />
                    )}
                </div>
            );
        }
        if (subpage === 'buyings') {
            return (
                <div>
                    <Navbar/>
                    <ProfileNav/>
                    <ProfileBuyings/>
                </div>
            );
        }
    }
}
